    //             <Suspense fallback={<h1>Loading...</h1>}>
    //                 <FirstPage />
    //             </Suspense>
    //         }/>  
    // </Route> 

    <Route path="/" >
        <Route index  element={<Suspense fallback={<h1>Loading...</h1>}><Auth /></Suspense>}/>
        <Route path="App" element={<Layout />}>
            <Route path="RotEbal" element={<h1>Idi naxyi</h1>}/>  
        </Route> 
    </Route>
))

const Main = () => {
    return(
        <div className="main">
            <RouterProvider router={router} />
        </div>
    )
}

export {Main}
